import React from 'react'
import { useNavigate } from 'react-router-dom';

function AdminPage() {

  if (!isLoggedIn) {
    // Redirect the user to a login page or show an access denied message
    navigate('/login');
  }

  return (
    <div>
      <h2>HELLO</h2>
    </div>
  );
}

export default AdminPage;
